import React from 'react';

const Home = () => {
    return (
        <div style={{ paddingTop: '50px', textAlign: 'center', fontFamily: 'Roboto, sans-serif' }}>
            <h2>Welcome to Recipe Manager</h2>
            <p>Organize, discover, and share your favorite recipes with ease!</p>
            <h3>Key Features</h3>
            <ul>
                <li>Create and manage your own recipes</li>
                <li>Organize recipes into categories for easy access</li>
                <li>Discover new recipes from a vast collection</li>
                <li>Share your favorite recipes with friends and family</li>
            </ul>
            <button>Get Started</button> {/* Example of a call-to-action button */}
            <p>Already have an account? <a href="/login">Log in</a></p> {/* Example of a navigation link */}
        </div>
    );
};

export default Home;
